// 		description:
// 			'I throw myself down among the tall grass by the stream as I lie close to the earth.',
// 	},
// ];
class Service extends Component {
	render() {
		return (
			<React.Fragment>
				<PageHelmet pageTitle='Services' />
				<Header
					headertransparent='header--transparent'
					colorblack='color--black'
					logoname='logo.png'
				/>

				{/* Start Breadcrump Area */}
				<Breadcrumb title={'Service'} />
				{/* End Breadcrump Area */}

				{/* Start Service Area */}
				<div id='development' className='service-area ptb--120 bg_color--5'>
					<div className='container'>
						<div className='row'>
							<div className='col-lg-12'>
								<div className='section-title text-center mb--30'>
									<h2> Software Development</h2>
								</div>
								<div className='servicesBlurb'>
									<p>
										There are many variations of passages of Lorem Ipsum
										available, <br /> but the majority have suffered alteration.
									</p>
								</div>
							</div>
						</div>
					</div>
				</div>
				{/* End Service Area */}

				{/* Start Service Area */}
				<div id='marketing' className='service-area ptb--120 bg_color--1'>
					<div className='container'>
						<div className='row'>
							<div className='col-lg-12'>
								<div className='section-title text-center mb--30'>
									<h2>Marketing and Research</h2>
									<p>
										There are many variations of passages of Lorem Ipsum
										available, <br /> but the majority have suffered alteration.
									</p>
								</div>
							</div>
						</div>
					</div>
				</div>
				{/* End Service Area */}

				{/* Start Service Area */}
				<div
					id='branding'
					className='service-area creative-service-wrapper pt--90 pb--120 bg_color--5'
				>
					<div className='container'>
						<div className='row'>
							<div className='col-lg-12'>
								<div className='section-title text-center mb--30'>
									<h2>Branding & Design</h2>
									<p>
										There are many variations of passages of Lorem Ipsum
										available, <br /> but the majority have suffered alteration.
									</p>
								</div>
							</div>
						</div>
					</div>
				</div>
				{/* End Service Area */}
				{/* Start Service Area */}
				<div
					id='aws'
					className='service-area creative-service-wrapper pt--90 pb--120 bg_color--5'
				>
					<div className='container'>
						<div className='row'>
							<div className='col-lg-12'>
								<div className='section-title text-center mb--30'>
									<h2>AWS Management</h2>
									<p>
										There are many variations of passages of Lorem Ipsum
										available, <br /> but the majority have suffered alteration.
									</p>
								</div>
							</div>
						</div>
					</div>
				</div>
				{/* End Service Area */}

				{/* Start Service Area */}
				<div
					id='consulting'
					className='service-area creative-service-wrapper pt--90 pb--120 bg_color--1'
				>
					<div className='container'>
						<div className='row'>
							<div className='col-lg-12'>
								<div className='section-title text-center mb--30'>
									<h2>Strategy & Consulting</h2>
									<p>
										There are many variations of passages of Lorem Ipsum
										available, <br /> but the majority have suffered alteration.
									</p>
								</div>
							</div>
						</div>
					</div>
				</div>
				{/* End Service Area */}

				{/* Start Back To Top */}
				<div className='backto-top'>
					<ScrollToTop showUnder={160}>
						<FiChevronUp />
					</ScrollToTop>
				</div>
				{/* End Back To Top */}

				<Footer />
			</React.Fragment>
		);
	}
}
export default Service;
